        X_all = numpy.zeros((len(y_all)-Twindow+1,9))
        for Index in range(len(y_all)-Twindow+1):
            X_all[Index,:] = numpy.hstack((y_all[Index:Index+Twindow],TE[Index:Index+Twindow],PR[Index:Index+Twindow]))

        X_norm = numpy.copy(X_all)
        for r in range(X_all.shape[0]):
            X_norm[r,:] = (X_all[r,:] - mu)/sigma

        m = X_norm.shape[0]
        tmp = numpy.ones((m,1),dtype=numpy.float64)
        h1 = 1.0/(1.0+numpy.exp(-numpy.dot(numpy.hstack((tmp,X_norm)),numpy.transpose(Theta1))))
        h2 = 1.0/(1.0+numpy.exp(-numpy.dot(numpy.hstack((tmp,h1)),numpy.transpose(Theta2))))
        ListeVentVitessePrediction = 1+numpy.argmax(h2,axis=1) # JMV: Need to double check whether 1 needs to be added or not

